import React from "react";
import { FaBars } from "react-icons/fa";

class List extends React.Component{
    render(){
        return(
            <div className="List">
                <header>
                    <FaBars/>
                    <form>
                        <input/>
                    </form>
                </header>
            </div>
        )
    }
}

export default List
